import cRequest from '../index'

class loginRequest {
    accountLoginAccount() {
        let data;
        cRequest.getRequest("/1/classes/tb_user").then((res => {
            console.log(res);
            data = res;
            return res;
        }))
    }
}
export default new loginRequest();
